      "content": { "type": 0, "body": { "type": 2, "items": [{ "type": 3 }], "static": "I. The Constitution of Turkmenistan adopted on May 18, 1992, approved in the form established by the Constitutional Law of Turkmenistan on September 14, 2016 (Majlis Nalaty Turkmenistan, 2016, No. 3, Article 131; 2017, No. 3, Article 4, Article 130, 2020 ., No. 3 article 68) make the following changes and additions:" } }
