      "title": { "type": 0, "body": { "type": 2, "items": [{ "type": 3 }], "static": "About the People's Council of Turkmenistan" } },
      "content": { "type": 0, "body": { "type": 2, "items": [{ "type": 3 }], "static": "Taking into account the centuries-old experience of the Turkmen people in the part of the state system, holding public meetings with authorized representatives of the public of our ancestors, following their noble traditions, solving the most important political, economic and social issues and following generally recognized democratic principles, as well as the population. In order to ensure the participation of broad sections of the population in the adoption of important social and political decisions, the current Constitutional Law on the People's Council of Turkmenistan - the highest representative body of the people's power - is adopted." } }
